def count_symbols(dna_string):
    symbol_counts = {'A': 0, 'C': 0, 'G': 0, 'T': 0}
    for symbol in dna_string:
        symbol_counts[symbol] += 1
    return symbol_counts['A'], symbol_counts['C'], symbol_counts['G'], symbol_counts['T']
dna_string =''
counts = count_symbols(dna_string)
print(" ".join(str(count) for count in counts))
